import React from 'react';

const YouTubePlayer = (props) => {
  return (
    <div>
      <h2>YouTube Player</h2>
      <iframe
        width="560"
        height="315"
        src="https://www.youtube.com/embed/VIDEO_ID"
        title="YouTube video player"
        allow="fullscreen"
      ></iframe>
    </div>
  );
};

export default YouTubePlayer;
